apiVersion: primehub.io/v1alpha1
kind: PhAppTemplate
metadata:
  name: dagster
  annotations:
    helm.sh/hook: post-install, post-upgrade
spec:
  name: Dagster
  description: The cloud-native orchestrator for the whole development lifecycle, with integrated lineage and observability, a declarative programming model, and best-in-class testability.
  version: v1.3.11
  docLink: https://docs.dagster.io/getting-started
  icon: data:image/jpeg;base64,
  defaultEnvs:
  - defaultValue: /opt/dagster/app/hello-dagster.py
    description: Dagster python script file path.
    name: DAGSTER_PYTHON_FILE
    optional: false
  - defaultValue: /opt/dagster/app
    description: Dagster home directory.
    name: DAGSTER_HOME
    optional: true
  template:
    spec:
      podTemplate:
        spec:
          containers:
          - name: dagster
            image: infuseai/primehub-apps:dagster-v1.3.11
            command:
            - bash
            - -c
            args:
            - cd $(dirname $DAGSTER_PYTHON_FILE);
              [ -f "packages.txt" ] && apt-get update && xargs -P1 apt-get install -yq < packages.txt;
              [ -f "requirements.txt" ] && pip install --upgrade pip && xargs -n 1 pip install < requirements.txt;
              sh /opt/dagster/app/dagster-daemon.sh;
              dagit -f $(DAGSTER_PYTHON_FILE) -h "0.0.0.0" -p "3000" --path-prefix $(PRIMEHUB_APP_BASE_URL)
            ports:
            - containerPort: 3000
              name: http
              protocol: TCP
      svcTemplate:
        spec:
          ports:
          - name: http
            port: 3000
            protocol: TCP
            targetPort: 3000
      httpPort: 3000
